func lengthOfLongestSubstring(_ s: String) -> Int {
    var longestLen = 0
    var subStrDict:[Character:Int] = [:]
    let strLength = str.count
    let strArr = Array(str)
    for i in 0...strLength-1{
        subStrDict = [:]
        var subString = ""
        for j in i...strLength-1{
            if let currentChar = subStrDict[strArr[j]]{
                break
            }
            else{
                subStrDict[strArr[j]] = 0
                subString = subString+String(strArr[j])
                if(subString.count>longestLen){
                    longestLen = subString.count
                }
            }
        }
        if(longestLen>=(strLength-i)){
            break
        }
    }
    return longestLen
}

func lengthOfLongestSubstring1(s:String) ->Int{
    var maxLength = 0
    var start = 0, end = 0
    let strLength = s.count
    var subStrDict:[Character:Int] = [:]
    let strArr = Array(s)
    for end in 0...strLength-1{
        if let currentCharIndex = subStrDict[strArr[end]]{
            start = start>(currentCharIndex+1) ? start:currentCharIndex
        }
        else{
            subStrDict[strArr[end]] = end
            maxLength = maxLength>(end-start+1) ? maxLength:(end-start+1)
        }
    }
    return maxLength
}
